Like in JavaScript, in Dart var is short for variable. It is used to declare a variable whose type is statically inferred : var mystr = "shimmer"; In the example above, we declare a variable of type String. One of the convenient features of Dart is that it's able to infer the type of a variable based on the value that's assigned to it. Here, it's quite evident that it's a String type. But unlike JavaScript, you CANNOT change the type of the variable afterwards! var mystr = "shimmer";
mystr = 10; // THIS ASSIGNMENT DOESN'T WORK! When we attempt to change the type of a variable in Dart, the compiler will generate an error. This is because Dart is a statically typed language, which means that the data type of a variable is determined at compile-time and cannot be changed during runtime. Another way to declare variables is the explicit type declaration: String mystr = "shimmer"; In Dart, it's generally considered good practice to explicitly declare the data type of a property when defining a class. This helps to ensure that the code is more easily understood and maintainable, especially when working on larger projects with multiple developers. For variables within smaller scopes, such as a method, the "var" keyword can be used instead of explicitly declaring the data type. This is because the scope is smaller and it's often easier to infer the type of the variable based on the context of the code. class MyCat { String cat = "Bob"; void someMethod() { var anotherVariable = "Tom"; }
}

