} pub struct SendToDartLogger { level: LevelFilter,
} impl SendToDartLogger { pub fn set_stream_sink(stream_sink: StreamSink<LogEntry>) { let mut guard = SEND_TO_DART_LOGGER_STREAM_SINK.write(); let overriding = guard.is_some(); *guard = Some(stream_sink); drop(guard); if overriding { warn!( "SendToDartLogger::set_stream_sink but already exist a sink, thus overriding. \ (This may or may not be a problem. It will happen normally if hot-reload Flutter app.)" ); } } pub fn new(level: LevelFilter) -> Self { SendToDartLogger { level } } fn record_to_entry(record: &Record) -> LogEntry { let time_millis = SystemTime::now() .duration_since(UNIX_EPOCH) .unwrap_or_else(|_| Duration::from_secs(0)) .as_millis() as i64; let level = match record.level() { Level::Trace => Self::LEVEL_TRACE, Level::Debug => Self::LEVEL_DEBUG, Level::Info => Self::LEVEL_INFO, Level::Warn => Self::LEVEL_WARN, Level::Error => Self::LEVEL_ERROR, }; let whole_msg = format!("{}", record.args()); let tag; let user_id; let user; let msg; if whole_msg.starts_with("my_domain") { let vector: Vec<&str> = whole_msg.split("@@@").collect(); //Position 1: Domain //Position 2: Tag tag = format!("{}", vector[1]); //Position 3: User-ID user_id = format!("{}", vector[2]).to_string(); //Position 4: User user = format!("{}", vector[3]).to_string(); //Position 5: Message msg = format!("{}", vector[4]); } else { tag = record.file().unwrap_or_else(|| record.target()).to_owned().to_string(); user_id = "".into(); user = "".into(); msg = format!("{}", record.args()); } LogEntry { time_millis, level, tag, user_id, user, msg, } } const LEVEL_TRACE: i32 = 5000; const LEVEL_DEBUG: i32 = 10000; const LEVEL_INFO: i32 = 20000; const LEVEL_WARN: i32 = 30000; const LEVEL_ERROR: i32 = 40000;
} impl Log for SendToDartLogger { fn enabled(&self, _metadata: &Metadata) -> bool { true } fn log(&self, record: &Record) { let entry = Self::record_to_entry(record); if let Some(sink) = &*SEND_TO_DART_LOGGER_STREAM_SINK.read() { sink.add(entry); } } fn flush(&self) { // no need }
} impl SharedLogger for SendToDartLogger { fn level(&self) -> LevelFilter { self.level } fn config(&self) -> Option<&Config> { None } fn as_log(self: Box<Self>) -> Box<dyn Log> { Box::new(*self) }
