pub fn create_wallet_account(network_info: NetworkInfo, wallet_info: WalletInfo) -> Result<String> { let rt = Runtime::new().unwrap(); rt.block_on(async { let node_url = network_info.node_url; let stronghold_password = wallet_info.stronghold_password; let stronghold_filepath = wallet_info.stronghold_filepath; // Create the needed directory according to the given path let mut path_buf = PathBuf::new(); path_buf.push(&stronghold_filepath); let path = PathBuf::from(path_buf); fs::create_dir_all(path).ok(); // THIS NEXT STEP IS CRUCIAL: // Point the "current working directory" to the given path env::set_current_dir(&stronghold_filepath).ok(); // Create the Rust file for the stronghold snapshot file let mut path_buf_snapshot = PathBuf::new(); path_buf_snapshot.push(&stronghold_filepath); path_buf_snapshot.push("wallet.stronghold"); let path_snapshot = PathBuf::from(path_buf_snapshot); let mut secret_manager = WalletStrongholdSecretManager::builder() .password(&stronghold_password) .build(path_snapshot)?; // Storing the mnemonic is ONLY REQUIRED THE FIRST TIME // calling it TWICE THROWS AN ERROR secret_manager.store_mnemonic(wallet_info.mnemonic).await?; // Create a ClientBuilder (= client_options in wallet.rs) // See wallet.rs: // -> src/lib.rs // -> line "pub use iota_client::ClientBuilder as ClientOptions" let client_options = ClientOptions::new().with_node(&node_url)?; // Create the account manager with the secret_manager // and client_options (= ClientBuilder). // The Client itself is created in the AccountManagerBuilder's finish() method. // See wallet.rs: // -> src/account_manager/builder.rs // -> line "let client = client_options.clone().finish()?;" let manager = AccountManager::builder() .with_secret_manager(WalletSecretManager::Stronghold(secret_manager)) .with_client_options(client_options) .with_coin_type(SHIMMER_COIN_TYPE) .finish() .await?; // Create a new account let _account = manager .create_account() .with_alias((&wallet_info.alias).to_string()) .finish() .await?; Ok("Wallet Account was created successfully.".into()) })
} The two structs passed as input parameters contain data from Flutter that is needed to create the wallet. These include the node URL, the mnemonics, the Wallet Alias, the Stronghold Password, and the directory path where both the wallet's database and the Stronghold Snapshot file will be stored. In the first part of the function, we need to create a PathBuf . It is commonly used when dealing with file I/O operations and working with file systems in Rust. PathBuf is a type that represents a platform-dependent path. It is used to manipulate and work with file paths in a convenient and cross-platform manner. PathBuf provides various methods for path manipulation, such as joining paths, appending components, and resolving relative paths. The crucial part of working with paths in our library is that we change the current working directory to our specific path for the database and snapshot file. By doing so, we can perform file operations relative to that directory or access files located in that specific path. In the next part of the function, we create a Stronghold Secret Manager that is initialized with our Stronghold password and mnemonics. We have chosen to use Stronghold in our wallet for secure storage and management of sensitive information. The StrongholdSecretManager uses advanced encryption techniques to protect the stored data and provides secure access methods for retrieving and using the secrets when required. It offers features like encryption, decryption, secure key generation, and secure storage of cryptographic material. Our goal of creating a wallet account is achieved through the Account Manager . The Account Manager provides a set of functionalities and APIs to manage multiple accounts within a wallet. It allows us to create, modify, and interact with individual accounts, such as generating addresses, sending transactions, and retrieving account information. The Account Manager is configured with our Stronghold Secret Manager and the Client "Options". ClientOptions is nothing more than the ClientBuilder in the original iota-client. Keep this in mind! Once we have created the Account Manager, there is only one step left, which is creating a new Account for the given wallet Alias. The account's Alias serves as a name or identifier for the account within the wallet. By creating a new Account, we establish a distinct entity within the wallet to manage specific funds, transactions, and associated addresses. This step enables us to organize and track different accounts within the wallet application effectively. Behind the scenes, when creating the Stronghold Secret Manager, the snapshot file is generated. Additionally, when creating the Account Manager, a RocksDB database is created. It is worth noting that the use of RocksDB has previously caused issues between different target platforms with older versions of wallet.rs. Let's see if this problem still persists. In the next section, I will attempt to build the library for all platforms and investigate if any conflicts arise.

