llet = Some( Wallet::builder() .with_secret_manager(WalletSecretManager::Stronghold(secret_manager)) .with_client_options(client_options) .with_coin_type(SHIMMER_COIN_TYPE) .finish() .await?, ); Ok("Wallet Account was created successfully.".into()) }) } fn create_account(&self, wallet_info: WalletInfo) -> Result<String> { let wallet_singleton = self; let result = Runtime::new().unwrap().block_on(async { if let Some(ref wallet) = wallet_singleton.wallet { let wallet_alias = wallet_info.alias; let _account = wallet .create_account() .with_alias((&wallet_alias).to_string()) .finish() .await?; Ok("Account was created successfully.".into()) } else { Err(Error::msg("No wallet set.")) } }); result } fn generate_address(&self, wallet_info: WalletInfo) -> Result<String> { let wallet_singleton = self; let rt = Runtime::new().unwrap(); rt.block_on(async { if let Some(ref wallet) = wallet_singleton.wallet { let stronghold_password = wallet_info.stronghold_password; let wallet_alias = wallet_info.alias; let account = wallet.get_account((&wallet_alias).to_string()).await?; wallet.set_stronghold_password(stronghold_password).await?; let addresses = account.generate_ed25519_addresses(1, None).await?; Ok(addresses[0].address().to_string()) } else { Err(Error::msg("No wallet set.")) } }) } fn check_balance(&self, wallet_info: WalletInfo) -> Result<BaseCoinBalance> { let wallet_singleton = self; let rt = Runtime::new().unwrap(); rt.block_on(async { if let Some(ref wallet) = wallet_singleton.wallet { let stronghold_filepath = wallet_info.stronghold_filepath; env::set_current_dir(&stronghold_filepath).ok(); let wallet_alias = wallet_info.alias; let account = wallet.get_account((&wallet_alias).to_string()).await?; // Sync and get the balance let account_balance = account.sync(None).await?; let base_coin_balance = BaseCoinBalance { total: account_balance.base_coin().total(), available: account_balance.base_coin().available(), }; //let total = account_balance.base_coin.total; //println!("{