In Flutter, a component is a self-contained, reusable piece of a user interface. It is a widget that can be used in a Flutter app to create a specific visual and/or interactive element, such as a button, text field, or image. A component in Flutter can be composed of other components, making it possible to create complex UIs by assembling smaller, reusable parts. Doesn't that sound familiar to you!? Let's compare a single Flutter widget with a Vue.js component. In Flutter you write the whole component as Dart code: import 'package:flutter/material.dart'; class MyButton extends StatelessWidget { @override Widget build(BuildContext context) { return ElevatedButton( onPressed: () { print('Button clicked'); }, child: Text( 'Klick mich!', style: TextStyle(color: Colors.white), ), style: ButtonStyle( backgroundColor: MaterialStateProperty.all<Color>(Colors.green), shape: MaterialStateProperty.all<RoundedRectangleBorder>( RoundedRectangleBorder( borderRadius: BorderRadius.circular(20), ), ), ), ); }
} In Vue.js it looks like: <template> <button @click="handleClick" class="my-button">Klick mich!</button>
</template> <script>
export default { methods: { handleClick() { console.log('Button clicked'); } }
}
</script> <style>
.my-button { background-color: green; color: white; padding: 10px; border: none; border-radius: 20px; cursor: pointer;
}
